package org.gitor.autodeployoss.entity;/** * 参数对象 * @author : liuwenlong * @date : 2018/6/4 14:23 */public class ParamsPojo {    /**     * oss类型 , 参照 Contans     */    private Integer ossType;    /**     * git 地址     */    private String gitUrl;    /**     * 分支名     */    private String branch;    private String ossUrl;    public String getBranch() {        return branch;    }    public void setBranch(String branch) {        this.branch = branch;    }    public Integer getOssType() {        return ossType;    }    public void setOssType(Integer ossType) {        this.ossType = ossType;    }    public String getGitUrl() {        return gitUrl;    }    public void setGitUrl(String gitUrl) {        this.gitUrl = gitUrl;    }    public String getOssUrl() {        return ossUrl;    }    public void setOssUrl(String ossUrl) {        this.ossUrl = ossUrl;    }}